import React from 'react';
import './App.css';
import './assets/andrei.jpg';

function Home() {
  return (
    <div id="home">
      <div className="App-aboutBG">
        <p className="App-aboutName">About Me</p>
 
      </div>
      
      
    </div>
  );
}

export default Home;
